"Stepping out of the draining density on higher grounds, filling our thirsty lungs with fresh air of new beginnings & freedom - a new world where sky & earth becomes one."

We have been waiting for two days within the clouds at this exposed location in the Dolomitian alps with a maximum view of 10m, freezing & unsure if the peaks will show. Then suddenly the wall of clouds broke open and revealed the mountain tops while we were running around like lunatics to not mess up the few moments we had to nail the shot I've dreamed about.

